Rather than have all the callers add the redfish tags, would it make sense for this wrapper to add it internally?

So, the function signature might look something like this:

void estoragedLogging(const char* redfishMessageId, const char* message, ...);

I'm finding that this function is causing segfaults in my unit tests. I think you need to use a va_list:

va_list args;
va_start(args, fmt);
sd_journal_send(fmt, args, NULL);
va_end(args);
